/*
 * Wrapper functions to enable static key branch functionalities to be
 * inserted into the kernel through LLVM without too much trouble, as macros
 * cannot be inserted during instrumentation. 
 *
 * As a solution to the static key problem, we have to manually declare and
 * define a specific mitigation-component function for all possible indirect
 * call IDs in the kernel.
 * 
 * While very unscalable and not practical at all, there is no other way at
 * the moment. So, deal with this for now and try to fix this later.
 */
